import React from "react";
import { Container } from "react-bootstrap";
import { useSelector } from "react-redux";
import { Card, Button } from "react-bootstrap";

function HomeTour() {
    const calendar = useSelector((state) => state.calendar);

    if (!calendar)
    {
        return (
            <h3 className="text-center">Hiện tại chưa có giải đấu</h3>
        )
    }
    return (
        <Container className="mt-5">
            <h1>{`Giải này hiện có ${teams.length} đội bóng`}</h1>
            {teams.map((team) => {
                return (
                    <Card style={{ width: "100%" }}>
                        <Card.Body>
                            <Card.Title>{team.teamName}</Card.Title>
                            <Card.Text>
                                {team.homeGround}
                            </Card.Text>
                            <Button variant="primary">{`Đội này có ${team.playerList.length} cầu thủ`}</Button>
                        </Card.Body>
                    </Card>
                );
            })}
        </Container>
    );
}

export default HomeTour;
